goog.provide('Blockly.Blocks.dwenguino');

goog.require('Blockly.Blocks');

Blockly.Blocks.dwenguino.HUE = 315;

Blockly.Blocks['initdwenguino'] = {
  init: function() {
    this.appendDummyInput()
        .setAlign(Blockly.ALIGN_RIGHT)
        .appendField("initDwenguino");
    this.setPreviousStatement(true);
    this.setNextStatement(true);
    this.setColour(Blockly.Blocks.dwenguino.HUE);
    this.setTooltip('');
    this.setHelpUrl('http://www.dwengo.org/tutorials');
  }
};

