Blockly.Blocks['remote_sensor'] = {
  helpUrl: 'http://www.arduino.cc/playground/ComponentLib/servo',
  init: function() {
    this.setColour(Blockly.Blocks.base.Hue);
    this.appendDummyInput()
        .appendField("Remote")
    this.appendDummyInput()
        .appendField(new Blockly.FieldImage("data:image/png;base64,", 40, 40))
    this.appendValueInput("tsop","Number")
    this.setOutput(true, 'Number');
    this.setTooltip('return that pin number of tsop connection to arduino');
  }
};


